import React from 'react';
import { Link } from 'react-router-dom';
import {Nav,NavDropdown,Dropdown,DropdownButton, Button} from 'react-bootstrap'
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';
import{ faCog } from '@fortawesome/free-solid-svg-icons';

import './Navbar.css';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';
function Navbar(props) {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light navbar-custom">
<Navbar>
  <Navbar.Brand>
    <FontAwesomeIcon icon={faCog}/>
{' '}
Employee Management System
  </Navbar.Brand>
</Navbar>
    <button className="navbar-toggler" 
    type="button" 
    data-bs-toggle="collapse" 
    data-bs-target="#navbarSupportedContent" 
    aria-controls="navbarSupportedContent" 
    aria-expanded="false" 
    aria-label="Toggle navigation">
      <span  className="navbar-toggler-icon"></span>
    </button>
<NavbarCollapse id="basic-navbar-nav">
    <Nav className="ml-auto">
    </Nav>
    </NavbarCollapse>
    <Nav className="ml-auto">
    <Link to="/addemployee" ><Button style={{backgroundColor:' ',color:'black'}}className='custom-button'>Home</Button></Link>
    </Nav>
 

    <DropdownButton title="Login" style={{color:'black'}} className="custom-dropdown-button">
<Dropdown.Item href="#">Admin</Dropdown.Item>
{/* <NavDropdown.Divider></NavDropdown.Divider> */}
<Dropdown.Item href="#">Manager</Dropdown.Item>
{/* <NavDropdown.Divider></NavDropdown.Divider> */}
<Dropdown.Item href="#">Employee</Dropdown.Item>
    </DropdownButton>
   
   
              </nav>

    </div>
  );
}

export default Navbar;
